(1, '4.7 Huawei KHWUMY80 128 ГБ  черный', './src/img/phon2.png', 640, '  В смартфоне Samsung SM-J260F Galaxy J2 Core нет ничего лишнего, в результате чего он станет идеальным приобретением для практичных пользователей, которые желают использовать его для банковских операций, звонков и работы в нересурсоемких приложениях. Компактность рассматриваемому аппарату обеспечил 5-дюймовый экран, который подарит вам захватывающий просмотр любого видеоматериала за счет большого экранного пространства. Эффективное и безотказное использование устройства гарантировано улучшенной в плане производительности операционной системой Android Oreo, представленной в редакции Go.\r\nСо смартфоном Samsung SM-J260F Galaxy J2 Core вы всегда будете на шаг впереди за счет его оптимизации для работы Google Go, благодаря которой вы сможете устанавливать на него облегченные версии популярных приложений. Высокая емкость аккумулятора, равная 2600 мАч, гарантирует длительную работу аппарата в активном режиме без необходимости его подзарядки. Дополнительно имеется функция энергосбережения, экономящая запас батареи путем оптимизации производительности и уменьшения яркости экрана.  '),
